import React from 'react';
// import './header.css';

function Header() {
    return (
        <div className="header">
            <div className="NavBar">
                <ul>
                    <li>Home</li>
                    <li>News</li>
                    <li>Contact</li>
                    <li>About</li>
                </ul>
            </div>
            
            <h1>Vivien Renee</h1>
        </div>
        
    );
}

export default Header;
